def predict(triples: list[Triple]) -> str:
        sentence = ""
        subject = None
        related_info = []

        for triple in triples:
            if subject is None:
                subject = triple.subject
                related_info.append(triple)
            elif triple.subject == subject:
                related_info.append(triple)
            else:
                # Handle a new subject - create a sentence from related_info first
                sentence += build_sentence(subject, related_info) + " "
                subject = triple.subject
                related_info = [triple]

        # Build sentence for the last subject
        if subject:
            sentence += build_sentence(subject, related_info)

        return sentence

    def build_sentence(subject, related_info):
        sentence_parts = []
        for triple in related_info:
            if triple.predicate == "architecturalStyle":
                sentence_parts.append(f"{subject} is built in {triple.object} style")
            elif triple.predicate == "buildingStartDate":
                sentence_parts.append(f"Construction of {subject} started in {triple.object}")
            elif triple.predicate == "completionDate":
                sentence_parts.append(f"and was completed in {triple.object}")
            elif triple.predicate == "floorCount":
                sentence_parts.append(f"{subject} has {triple.object} floors")
            elif triple.predicate == "location":
                sentence_parts.append(f"and is located in {triple.object}")
            elif triple.predicate == "cost":
                sentence_parts.append(f"and cost {triple.object}")
            elif triple.predicate == "floorArea":
                sentence_parts.append(f"and has a floor area of {triple.object}")
            elif triple.predicate == "owner":
                sentence_parts.append(f"and is owned by {triple.object}")
            elif triple.predicate == "formerName":
                sentence_parts.append(f"and was formerly known as {triple.object}")
            elif triple.predicate == "height":
                sentence_parts.append(f"and has a height of {triple.object} metres")
            elif triple.predicate == "buildingType":
                sentence_parts.append(f"and is a {triple.object}")
            elif triple.predicate == "developer":
                sentence_parts.append(f"and was developed by {triple.object}")
            elif triple.predicate == "tenant":
                sentence_parts.append(f"and its tenant is {triple.object}")
            elif triple.predicate == "isPartOf":
                sentence_parts.append(f"and is part of {triple.object}")
            elif triple.predicate == "country":
                sentence_parts.append(f"and is located in {triple.object}")
            elif triple.predicate == "currentTenants":
                sentence_parts.append(f"and its current tenants are {triple.object}")
            elif triple.predicate == "address":
                sentence_parts.append(f"and its address is {triple.object}")
            elif triple.predicate == "inaugurationDate":
                sentence_parts.append(f"and was inaugurated on {triple.object}")
            else:
                sentence_parts.append(f"{triple.predicate} of {subject} is {triple.object}")

        if sentence_parts:
            return " ".join(sentence_parts) + "."
        else:
            return ""

    return sentence

